@aloqeliy ٢٣سنة من الاستقلال لم يقدم الحزب الاشتراكي للجنوب أي مشروع تنموي او خدمي أو حكومي المدارس والمستشفيات ولاجامعات.
بل ماخلفه لهم الاستعمار من مقدرات لم يحافظوا عليه.
مافعلوه بعد اجتياحهم حضرموت من مجازر وجرائم ومشانق لشيوخها وعلمائها ومصادرة لاملاكهم لن ينساها الحضارم والتاريخ.

@aloqeliy الوحدة اليمنية تعتبر أكبر شرف عربي ناله الجنوبيين في تاريخهم بعد سقوط دولتهم سياسياً وانهيارها إقتصادياً وتشرذمها إجتماعياً ومناطقياً.
الوحدة اليمنية قدمت للجنوبيين مالم يقدمه الاستعمار واستقلالهم العنصري الفاشل، الذي سرعان ماسقط وأنتهى. 
الوحدة كانت مصدر كرامة وعزة وسمو للجنوب
